import logo from './logo.svg';
import './App.css';
import styled from "styled-components";

function App() {

  const Title = styled.h1`
  font-size: 1.5em;
  text-align: center;
  color: palevioletred;
`;

  const thisBtn = styled.Button`
  background : palevioletred;
  color: white;
  font-size: 1em;
  margin: 1em;
  padding: 0.25em 1em;
  border: 2px solid palevioletred;
  border-radius: 3px;
  `;

// Create a Wrapper component that'll render a <section> tag with some styles
const Wrapper = styled.section`
  padding: 4em;
  background: papayawhip;
`;

  return (
    <div className="App">
          <Wrapper>
            <Title>
              Hello World!
            </Title>
            <thisBtn>Click Here</thisBtn>
          </Wrapper>
    </div>
  );
}

export default App;
